sidebarCSS:
#root.root {--tabs-font: 0.85rem sans-serif;}
#root.root {--tabs-indent: 0px;}
#root.root {--general-border-radius: 4px;}
#root.root {--toolbar-bg: #171717;}
#root.root {--frame-bg: #171717;}
#root.root {--tabs-height: 32px;}
#root.root {--tabs-margin: 6px;}
#root.root {--tabs-inner-gap: 13px;} /* Modify this to center the icons better */
#root.root {--pinned-tabs-col: 4;}
#root.root {
  flex-direction: column-reverse;
}

.Tab .ctx {
		left: 0px; /* This sets the container indicator border-color to the left, instead of the right */
}

.NavigationBar .main-items {
    justify-content: center;
}

.tooltip {
		display: none !important;
}

.Tab {
    min-width: 33px;
    transition: all ease-in-out 200ms;
}

.NavigationBar {
    transition: all ease-in-out 200ms;
}

.NavigationBar[data-layout="inline"] .main-items .nav-item {
    transform: translateX(0) !important;
    position: relative !important;
    flex-grow: 1;
    max-width: 66px;
}

.NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
    display: none;
}

.BottomBar {
    display: none;
}

.Tab .title {
    opacity: 0 !important;
    transition: ease-in-out 250ms;
}

.NavigationBar .main-items .audio {
		opacity: 0 !important;
}

.Tab[data-pin="true"] .fav, .Tab[data-pin="true"] .fav-icon {
    width: 20px;
    height: 20px;
}

.Tab[data-pin="false"] .fav, .Tab[data-pin="false"] .fav-icon {
    width: 18px;
    height: 18px;
}

.Tab[data-pin="true"][data-active="true"] .color-layer {
   background-color: #ffffff !important;
}

.Tab[data-pin="false"] .color-layer {
    opacity: 0 !important;
    border: 0 !important;
}

.Tab[data-pin="false"][data-active="true"] .body {
    box-shadow: rgba(17, 17, 26, 0.15) 0px 0px 16px;
}

.Tab[data-pin="false"] {
    border: 0 !important;
}

.Tab .title {
	background: linear-gradient(90deg, var(--tabs-normal-fg) 80%, #f1f1f100 99%);
	background-clip: text;
	color: transparent;
}

@media screen and (min-width: 350px) {
  .NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
      display: flex;
			opacity: 1;
			transition: none;
  }

  .BottomBar {
      display: flex;
  }
  #root.root {
      --tabs-indent: 14px;
  }
  .Tab .audio, .Tab .title {
      opacity: 1 !important;
  }
  #root.root {--tabs-pinned-height: 40px;}
  #root.root {--tabs-pinned-width: calc((100vw - (var(--tabs-margin) * (var(--pinned-tabs-col) + 1))) / var(--pinned-tabs-col));}
}

/* Minimized Sidebar */
@media screen and (max-width: 60px) {
  #root {
    --tabs-indent: unset !important;
  }

  .container {
      max-width: 60px;
  }

  .Tab .title {
     display: none;
  }

  .NavigationBar .nav-item#settings, .NavigationBar .main-items {
  	/*display: none;*/
		padding-right: 4px;
		padding-left: 4px;
  }
}

/* Audio Button Settings */
.Tab[data-audible="true"] .audio, .Tab[data-muted="true"] .audio, .Tab[data-paused="true"] .audio {
		background: var(--tabs-normal-bg);
		left: 20px;
		height: unset;
		bottom: 10px;
		top: unset;
}

.Tab[data-audible="true"] .t-box .title, .Tab[data-muted="true"] .t-box .title, .Tab[data-paused="true"] .t-box .title {
		--audio-btn-offset: 0px !important;
}
